#[derive(Debug)]
pub struct Xorshift {
    seed: u64,
}

impl Xorshift {
    #[allow(dead_code)]
    pub fn new() -> Xorshift {
        Xorshift {
            seed: 0xf0fb588ca2196dac,
        }
    }
    #[inline]
    pub fn next(&mut self) -> u64 {
        self.seed = self.seed ^ (self.seed << 13);
        self.seed = self.seed ^ (self.seed >> 7);
        self.seed = self.seed ^ (self.seed << 17);
        self.seed
    }
    #[inline]
    pub fn rand(&mut self, m: u64) -> u64 {
        self.next() % m
    }
}

fn create_prob_table(s: usize) -> Vec<Vec<f64>> {
    let mut res = vec![vec![0.0; 1001]; 1001];
    let mut prob_one = vec![0.0; 1001];
    let mut prob_half = vec![0.0; 1001];
    for i in 0..=1000 {
        prob_one[i] = if PROB_ONE[s][i] > 0.0 {
            PROB_ONE[s][i].ln()
        } else {
            -10000.0
        };
    }
    let mut val = PROB_ONE[s][1001];
    prob_half[1000] = if val > 0.0 { val.ln() } else { -10000.0 };
    for i in (0..1000).rev() {
        val += PROB_ONE[s][i];
        prob_half[i] = if val > 0.0 { val.ln() } else { -10000.0 };
    }
    for i in 0..=1000 {
        res[i][0] = prob_half[i];
        for j in 1..=999 {
            res[i][j] = prob_one[if i >= j { i - j } else { j - i }];
        }
        res[i][1000] = prob_half[1000 - i];
    }
    res
}

fn get_sqrt_idx(s: usize) -> usize {
    for i in 1..30 {
        if i * i == s {
            return i - 1;
        }
    }
    29
}

fn manhattan_points(dist: i32, upper_num: Option<usize>) -> Vec<(i32, i32)> {
    let mut res = Vec::new();
    res.push((0, 0));
    for d in 1..=dist {
        for x in -d..d {
            res.push((-x, d - x.abs()));
        }
        for x in -d..d {
            res.push((x, x.abs() - d));
        }
    }
    if let Some(u) = upper_num {
        if res.len() > u {
            res.truncate(u);
        }
    }
    res
}

fn generate_p_random(
    warm: &Vec<(usize, usize)>,
    s: usize,
    l: usize,
    points: &Vec<(i32, i32)>,
    upper: i32,
    base_num: u64,
) -> Vec<Vec<i32>> {
    let mut best = vec![vec![0; l]; l];
    let mut best_score = (0.0, 0);
    let mut rand = Xorshift::new();
    let start = std::time::Instant::now();
    loop {
        let mut res = vec![vec![0; l]; l];
        let mut fixed = vec![vec![false; l]; l];
        for pos in warm {
            for &(dx, dy) in points {
                let x = ((pos.0 + l) as i32 + dx) as usize % l;
                let y = ((pos.1 + l) as i32 + dy) as usize % l;
                if fixed[x][y] {
                    continue;
                }
                fixed[x][y] = true;
                res[x][y] = upper * rand.rand(base_num) as i32;
            }
        }
        let mut min_dif: f64 = 1e15;
        let mut place_cost: i32 = 0;
        for i in 0..l {
            for j in 0..l {
                place_cost += (res[i][j] - res[i][(j + 1) % l]).pow(2);
                place_cost += (res[i][j] - res[(i + 1) % l][j]).pow(2);
            }
        }
        for i in 0..warm.len() {
            for j in i + 1..warm.len() {
                let mut cnt = 0.0;
                for &(dx, dy) in points {
                    let x0 = ((warm[i].0 + l) as i32 + dx) as usize % l;
                    let y0 = ((warm[i].1 + l) as i32 + dy) as usize % l;
                    let x1 = ((warm[j].0 + l) as i32 + dx) as usize % l;
                    let y1 = ((warm[j].1 + l) as i32 + dy) as usize % l;
                    let mut v = (res[x0][y0] - res[x1][y1]) as f64 / (s * s) as f64;
                    v = v.min(9.0);
                    cnt += v * v;
                }
                min_dif = min_dif.min(cnt);
            }
        }
        let cur_cost = (min_dif, -place_cost);
        if cur_cost > best_score {
            best_score = cur_cost;
            best = res;
        }
        let duration = start.elapsed();
        let sec = duration.as_secs_f64();
        if sec >= 3.2 {
            break;
        }
    }
    eprintln!("best_score: {} {}", best_score.0, -best_score.1);
    let mut fixed = vec![vec![false; l]; l];
    for pos in warm {
        for &(dx, dy) in points {
            let x = ((pos.0 + l) as i32 + dx) as usize % l;
            let y = ((pos.1 + l) as i32 + dy) as usize % l;
            fixed[x][y] = true;
        }
    }
    for _ in 0..100 {
        let mut end = true;
        for x in 0..l {
            for y in 0..l {
                if fixed[x][y] {
                    continue;
                }
                let cur = best[x][y];
                let next = (best[x][(y + 1) % l]
                    + best[(x + 1) % l][y]
                    + best[x][(y + l - 1) % l]
                    + best[(x + l - 1) % l][y]
                    + 2)
                    / 4;
                if cur == next {
                    continue;
                }
                best[x][y] = next;
                end = false;
            }
        }
        if end {
            break;
        }
    }
    best
}

fn calc_answer(cost: &Vec<Vec<f64>>) -> Vec<usize> {
    let n = cost.len();
    let mut used_src = vec![false; n - 1];
    let mut used_dst = vec![false; n];
    let mut res = vec![0; n];
    let mut orders = vec![Vec::new(); n - 1];
    for i in 0..n - 1 {
        for j in 0..n {
            orders[i].push((j, cost[i][j]));
        }
        orders[i].sort_by(|a, b| a.1.partial_cmp(&b.1).unwrap());
    }
    let mut seek = vec![0; n - 1];
    let mut fixed_num = 0;
    while fixed_num != n - 1 {
        let mut cand = vec![Vec::new(); n];
        for i in 0..n - 1 {
            if used_src[i] {
                continue;
            }
            while used_dst[orders[i][seek[i]].0] {
                seek[i] += 1;
            }
            cand[orders[i][seek[i]].0].push(i);
        }
        for j in 0..n {
            if cand[j].is_empty() {
                continue;
            }
            if cand[j].len() == 1 {
                res[cand[j][0]] = j;
                used_src[cand[j][0]] = true;
                used_dst[j] = true;
                fixed_num += 1;
            } else {
                let mut val = 1e15;
                let mut idx = 0;
                for k in 0..cand[j].len() {
                    if cost[cand[j][k]][j] < val {
                        val = cost[cand[j][k]][j];
                        idx = k;
                    }
                }
                res[cand[j][idx]] = j;
                used_src[cand[j][idx]] = true;
                used_dst[j] = true;
                fixed_num += 1;
            }
        }
    }
    for i in 0..n {
        if used_dst[i] {
            continue;
        }
        res[n - 1] = i;
    }
    res
}

